5º Nível: Amplo ático com 2 salas para escritório e sala de tv.
Terreno 12m x 40m, perfazendo uma área total de 480m².

Um projeto funcional e bem localizado, que proporciona a você e sua família conforto, segurança e praticidade, aliados a uma excelente qualidade de vida e contato com a natureza.

