1° Pavimento: Sala de estar e TV, sala de jantar, cozinha, lavabo, área de serviço, espaço grill e garagem para 2 veículos;
2° Pavimento: Dormitório de casal (suíte com closet e sacada), 2 dormitórios de solteiro e banheiro;
3° Pavimento: Espaço home Office, theater e lareira;
